description:
Verenigde Staten / Duitsland
Sciencefiction / Actie
126 minuten

een zeer goeie film

met Chris Pine, Zachary Quinto en Eric Bana

James Tiberius Kirk is een ontzettende wildebras, maar blijkt ook een enorm getalenteerd ruimtevaarder te zijn, wanneer hij zich 
laat overhalen om een opleiding aan de Starfleet Academy te volgen. Bij het afleggen van zijn examen krijgt Kirk het aan de stok 
met zijn hyperintelligente collega Spock. De onbesuisde roekeloze Kirk en de berekenende kalme Spock zijn dan ook absolute 
tegenpolen. Naarmate de mannen elkaar beter leren kennen groeit echter de onderlinge waardering en dat is maar goed ook: als zij 
met het revolutionair futuristische ruimteschip USS Enterprise aan een zware en levensgevaarlijke reis beginnen moeten alle 
neuzen en ook alle oren, spits of niet, dezelfde kant op wijzen om de missie te laten slagen...
